      * { box-sizing: border-box; } body {margin: 0;}.flexblocks-row-container{display:flex;flex-direction:column;padding-top:10px;padding-right:10px;padding-bottom:10px;padding-left:10px;}.flexblocks-column-container{display:flex;flex-direction:row;padding-top:10px;padding-right:10px;padding-bottom:10px;padding-left:10px;}.flexblocks-item{min-height:75px;flex-basis:auto;flex-grow:1;}.c12832{min-height:50px;}.c667{height:100%;}.c651{height:100vh;}.c1365{width:100%;}.c1475{width:100%;}.c2971{min-height:50px;}.c1453{padding:10px;width:100%;}.c6661{max-width:400px;}.c7372{width:100%;}.c7463{width:100%;}
      
    #performance {
      display: none;
      min-width: 15em;
      min-height: 5em;
      position: absolute;
      top:1em;
      left:1em;

      background: #fff;
      box-shadow: 0 4px 16px rgba(0,0,0,.2);
      border: 1px solid rgba(0,0,0,.333);
    }

    #performance-btn {

      background-color: #eee;
      border: 1px solid rgba(0,0,0,.2);

      position:absolute;
      bottom:0;
      left:0;
      cursor: pointer;
    }

    #performance-header {
      transition: border-color 0.2s ease;
      box-sizing: border-box;
      background-color: #eee;
      border-bottom: 1px solid rgba(0,0,0,.2);
      height: 2em;
      line-height: 2em;
      margin: 0;
      vertical-align: middle;
      cursor: grab;
      padding-left: 1em;
    }

    #performance-header p {
      margin: 0;
      padding: 0;
      line-height: 2em;
      font-weight: 400;
    }

    #performance table {
      margin-top: 0.5em;
      width: 100%;
    }

    #performance td {
      padding: 0.1em;
    }

    #performance td.pwtd-name {

    }

    #performance td.pwtd-action {
      padding-left: 1em;
    }

    #performance td.pwtd-duration {
      text-align: right;
    }
  
      
    #spinner-blur {
      filter: blur(10px);
      transition: filter 0.3s ease-out;
    }

    #spinner {
      position: absolute;
      top: 0;
      left: 0;
      height: 100vh;
      width: 100vw;
      background-color: rgba(255, 255, 255, 0.5);
      transition: display 0.3s linear;
    }

    .lds-ring {
      display: inline-block;
      position: relative;
      width: 2vw;
      height: 2vh;
      position: absolute;
      left: 49vw;
      top: 49vh;
      z-index: 10;
    }
    .lds-ring div {
      box-sizing: border-box;
      display: block;
      position: absolute;
      width: 51px;
      height: 51px;
      margin: 6px;
      border: 6px solid #00b2ff;
      border-radius: 50%;
      animation: lds-ring 1.2s cubic-bezier(0.5, 0, 0.5, 1) infinite;
      border-color: #00b2ff transparent transparent transparent;
    }
    .lds-ring div:nth-child(1) {
      animation-delay: -0.45s;
    }
    .lds-ring div:nth-child(2) {
      animation-delay: -0.3s;
    }
    .lds-ring div:nth-child(3) {
      animation-delay: -0.15s;
    }
    @keyframes lds-ring {
      0% {
        transform: rotate(0deg);
      }
      100% {
        transform: rotate(360deg);
      }
    }
